-- Helper functions for slot gear database
GSTSlotGearHelpers = {}

-- Get items for a specific slot/spec/bracket
function GSTSlotGearHelpers.GetSlotItems(slotId, specId, bracket)
    local items = {}
    for _, item in ipairs(GSTSlotGearDb) do
        if item.slotId == slotId and item.specId == specId and item.bracket == bracket then
            table.insert(items, item)
        end
    end
    table.sort(items, function(a, b) return a.rank < b.rank end)
    return items
end

-- Find best matching variant for equipped item
function GSTSlotGearHelpers.FindBestMatch(equippedItemId, slotItems)
    -- First try exact itemId match
    for _, item in ipairs(slotItems) do
        if item.itemId == equippedItemId then
            return item
        end
    end
    return nil
end

-- Format item display with stats
function GSTSlotGearHelpers.FormatItemDisplay(item)
    local statsText = ""
    if item.statsShort and item.statsShort ~= "" then
        statsText = " (" .. item.statsShort .. ")"
    end
    local bisText = item.isBis and " (BiS)" or ""
    return string.format("%.1f%% - %s%s%s", item.percent, item.itemName, statsText, bisText)
end

